                    <div data-sid="header-message_1" class="sie-header-message_1 se">
                        <p class="se-t sie-header-message_1-text st-m-paragraph st-d-paragraph se-rc"><span
                                style="font-style: normal;">The wedding venue you choose is one of the biggest expenses
                                in your wedding budget, and that’s why it’s crucial to choose the venue that offers you
                                the most included in the price tag. <br><br>An all-inclusive wedding package can be
                                enticing for many couples as it includes much of the planning process for you. You might
                                have all your major vendors chosen for you and your wedding timeline all mapped out.
                                <br><br>This can also mean you get stuck with vendors you don’t love or a start time you
                                aren’t crazy about. Plus, nothing is customized to your wants and needs.
                                <br><br>Meanwhile, other venues might offer the space and nothing more, leaving you free
                                to plan every aspect yourself—which is just as overwhelming as it sounds. <br><br>At
                                Kendall Point, we like to place ourselves right in the middle. <br><br>You’re getting so
                                much more than a gorgeous wedding venue when you decide to get married at Kendall Point.
                                You’re getting enough seating during the ceremony and reception for up to 400 guests
                                plus <b>full, exclusive access</b> to the venue starting at 10 am on your wedding day.
                            </span><br><br>Spacious bridal and groom’s suites are yours for the day and night to get
                            ready, relax, take photos, play games, and more. <br><br>We’ve got a stacked list of
                            fantastic wedding vendors for you to choose from, including the top San Antonio wedding
                            planners, caterers, <a href="how-to-find-a-wedding-officiant/index.html"
                                target="_self">wedding officiants</a>, DJs, and more. Plus, you can bring your own
                            alcohol—a HUGE cost-saver. <br><br>Not to mention we handle all the setup and cleaning
                            duties. Check out <a href="amenities.html" target="_self">what else you’re getting</a>
                            when you choose Acre 31.<br><br></p>
                    </div>
